content:
Cho thuê nhà 2 Mặt tiền 180 Nguyễn Oanh + Hẻm hông 8m (Thông qua Lê Đức Thọ) 

Kết cấu: 1 trệt (100m2), 1 Gác (45m2); 2WC cuối nhà; Lề đường rộng

Kinh doanh tự do, trừ nhạy cảm/ quán nhậu;
Giá thuê: 36 triệu/ tháng (chưa thuế); HĐ 3~5 năm; cọc 3; TT1 ~3; 
Nhận nhà liền / Có hỗ trợ giá time dịch bệnh
Liên hệ SĐT or Zalo (Diễm Kiều)

Bán cao ốc mặt tiền số 14 đường Phan Tôn, phường Đakao, quận 1;
Diện tích 20x30m, công nhận gần 666m2 đất;

Hiện trạng gồm 1 hầm 1 trệt 7 lầu, đang cho thuê giá cao, hợp đồng dài hạn;
Giá mong muốn: 205 tỷ.

Vui lòng LH: 0911.86.37.39 _Ngọc Hải _BĐS VinGrand Center, trân trọng!
